  const name = 'Nine Dev';
  const nameList = ['Nine Dev', '2023', 'wwww'];
  const nameObj = {
    name: 'Nine Dev',
    old: 2023,
    email: 'tienkim9920@gmail.com',
  }

  const handleChangeName = () => {
    name = 'Nine Dev 2023';
  }

  return (
    <div className="App">
      {name}
      <div>{nameList}</div>
      <div>{nameObj.email}</div>
      <div>{nameObj.old}</div>
      <div>{nameObj.name}</div>

      <button onClick={handleChangeName}>Change Name</button>
    </div>
  );
}

export default App;
